import React from 'react'
import {IoClose} from 'react-icons/io5'
import {GiFlamingTrident} from 'react-icons/gi'
import {
    DropDown,
    DropUp,
    NavLogo,
    MenuLink,
    BeRide,
} from './style';


const DropDownMenu = () => {

    const [dropMenu , setDropMenu] = useState(false) 

    return (
        <DropDown>
            <DropUp>
                <NavLogo>
                    <MenuLink href="/">
                        <GiFlamingTrident/>  
                    </MenuLink>
                    <MenuLink href="/">
                        <BeRide>BeRide</BeRide>    
                    </MenuLink>
                </NavLogo>
                <IoClose onClick={ () => setDropMenu({dropMenu: !dropMenu}) }/>
                {
                dropMenu ? (<DropDownMe/>)
                : null
                }
            </DropUp>
        </DropDown>
    )
}

export default DropDownMenu
